import React from 'react';
import { Routes, Route, Navigate } from 'react-router-dom';

import CustomerLogin from './components/CustomerLogin';
import CustomerDashboard from './components/CustomerDashboard';
import AdminLogin from './components/AdminLogin';
import AdminDashboard from './components/AdminDashboard';
import Logout from './components/Logout';
import AdminLogout from './components/AdminLogout';
import AdminCustomerAdd from './components/AdminCustomerAdd';
import AdminAddCredit from './components/AddCredit';
import AdminAddDebit from './components/AddDebit';
import AdminCustomerList from './components/CustomerList';
import AdminCustomerDetails from './components/CustomerDetails';
import CustomerEdit from './components/CustomerEdit';

// Private Route wrapper for admin
function AdminPrivateRoute({ children }) {
  const token = localStorage.getItem('adminToken');
  return token ? children : <Navigate to="/admin/login" />;
}

// Private Route wrapper for customer
function CustomerPrivateRoute({ children }) {
  const token = localStorage.getItem('token');
  const expiry = localStorage.getItem('tokenExpiry');
  if (token && expiry && Date.now() > parseInt(expiry, 10)) {
    localStorage.removeItem('token');
    localStorage.removeItem('tokenExpiry');
    return <Navigate to="/customer/login" />;
  }
  return token ? children : <Navigate to="/customer/login" />;
}

function App() {
  return (
    <Routes>
      {/* Customer routes */}
      <Route path="/customer/login" element={<CustomerLogin />} />
      <Route
        path="/customer/dashboard"
        element={
          <CustomerPrivateRoute>
            <CustomerDashboard />
          </CustomerPrivateRoute>
        }
      />
      <Route path="/customer/logout" element={<Logout />} />

      {/* Admin routes */}
      <Route path="/admin/login" element={<AdminLogin />} />
      <Route path="/admin/logout" element={<AdminLogout />} />
      <Route
        path="/admin/dashboard"
        element={
          <AdminPrivateRoute>
            <AdminDashboard />
          </AdminPrivateRoute>
        }
      />
      <Route
        path="/admin/customers"
        element={
          <AdminPrivateRoute>
            <AdminCustomerList />
          </AdminPrivateRoute>
        }
      />
      <Route
        path="/admin/customers/add"
        element={
          <AdminPrivateRoute>
            <AdminCustomerAdd />
          </AdminPrivateRoute>
        }
      />
      <Route
        path="/admin/customers/:id"
        element={
          <AdminPrivateRoute>
            <AdminCustomerDetails />
          </AdminPrivateRoute>
        }
      />
      <Route
        path="/admin/customers/:id/adddebit"
        element={
          <AdminPrivateRoute>
            <AdminAddDebit />
          </AdminPrivateRoute>
        }
      />
      <Route
        path="/admin/customers/:id/addcredit"
        element={
          <AdminPrivateRoute>
            <AdminAddCredit />
          </AdminPrivateRoute>
        }
      />
      <Route path="/admin/customers/:id/edit" element={<CustomerEdit />} />


      {/* Redirect unknown routes */}
      <Route path="*" element={<Navigate to="/customer/login" />} />
    </Routes>
  );
}

export default App;
